import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import AudiobookList from './components/AudiobookList';
import AudiobookDetails from './components/AudiobookDetails';
import './components/AudiobookList.css';
import './components/AudiobookDetails.css';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Audiobooks</h1>
        <Switch>
          <Route path="/" exact component={AudiobookList} />
          <Route path="/audiobooks/:id" component={AudiobookDetails} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
